import React from "react";
import {Link} from "react-router-dom";

const NavBar = () => {
  return (
    <ul>
      <li>
        <Link to="/">Vidly</Link>
      </li>
      <li>
        <Link to="/movies">Movies</Link>
      </li>
      <li>
        <Link to="/customers">Customers</Link>
      </li>
      <li>
        <Link to="/rentals">Rentals</Link>
      </li>
    </ul>
  );
};

export default NavBar;
